import React from "react";
import "./About.css";

const About = () => {
  return (
    <div className="about">
      <div className="about_text">
        <h1 className="about_title">
          Laipni lūgti House of Light – mājīgā restorānā pašā Jūrmalas sirdī!
        </h1>
        <ul className="about_list">
          <li className="about_item1">
            Esam radījuši vietu, kur atpūsties no ikdienas steigas, baudīt gardu
            maltīti vai atspirdzinošu dzērienu.{" "}
          </li>
          <li className="about_item2"></li>
          <li className="about_item3"></li>
        </ul>
      </div>
    </div>
  );
};

export default About;
